const _hoisted_7 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Berserker</li><li>True Name: C\xFA Chulainn (Alter)</li><li>Gender: Male</li><li>Source: Celtic mythology</li><li>Origin: Europe</li><li>Alignment: Chaotic Evil</li><li>Height: 185 cm</li><li>Weight: 72 kg</li></ul><p><strong>Meta</strong></p><ul><li>Scenario writer: Higashide Y\u016Bichir\u014D</li><li>Character designer: Shimadrill</li><li>CV: Kanna Nobutoshi</li><li>Major appearances: Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">A</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">B+</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">A+</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">A</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Mad Enhancement: [EX] (equivalent to [C])</strong></p><p>Since he\u2019s a Berserker class born from a wish to the Grail, while it equals to C rank, it\u2019s possible to have a logical conversation.<br> However, since any use of sophistry has no effect, and decisions other than heading towards the target and pushing forwards won\u2019t happen, it can be said that a conversation with the opponent is substantially impossible.</p><p><strong>Divinity: [C]</strong></p><p>Aptitude to be a Divine Spirit.<br> C\xFA Chulainn, who is the child of the Sun god Lugh, is endowed with high aptitude to become a Divine Spirit.<br> Since he\u2019s been Altered, his Divinity is a rank down from usual.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Battle Continuation: [A]</strong></p><p>Doesn\u2019t know when to give up to the bitter end. The tenacity of a beast.<br> The ability to continue fighting. Can survive as long as he doesn\u2019t receive a decisive fatal wound, and it\u2019s possible to fight even if he receives wounds that leave him on the verge of death.</p><p><strong>Madness of the Elementals[1]: [A]</strong></p><p>The bellow of C\xFA Chulainn awakens the Elementals sleeping in the earth and crushes the mentality of the soldiers from the enemy army. A mental interference.<br> Temporarily ranks down the Strength and Agility parameters of all members of the enemy front.</p><p><strong>Rune Magecraft: [B]</strong></p><p>Possession of Scandinavian Magic Crests, Runes.<br> At the time of manifestation in this state, C\xFA Chulainn automatically activates the magecraft equivalent to the \u300CMagic Resistance\u300D skill.<br> (Fundamentally not used in \u300EFateGO\u300F)</p><p><strong>Protection against Arrows: [C]</strong></p><p>A defensive effect against projectile weapons.<br> Evades projectiles seen with the eyes that aren\u2019t caused by magecraft.<br> Since he\u2019s maddened, it suffers a drastic rank-down from usual.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="gae-bolg-spear-of-gouging-and-piercing-massacre" tabindex="-1"><a class="header-anchor" href="#gae-bolg-spear-of-gouging-and-piercing-massacre" aria-hidden="true">#</a> G\xE1e Bolg - Spear of Gouging and Piercing Massacre</h1><ul><li>Rank: B++</li><li>Type: Anti-Army Noble Phantasm</li><li>Range: 5~50</li><li>Maximum number of targets: 100 people</li></ul><p>G\xE1e Bolg.<br> A homing demonic spear missile. Almost the same Noble Phantasm as when usually summoned.<br> By throwing his automatic tracking demonic lance, he sweeps up the enemies within range. Since it\u2019s a full-power throw to the degree of being willing to collapse his own body, its power and effective range have risen when compared to his usual summoning. It has an instant death effect against the entire enemy front, and deals great damage in the case of not dying instantly.<br> Since he\u2019s throwing \u300Cwhile regenerating the collapsing body\u300Dthrough Rune magecraft, C\xFA Chulainn doesn\u2019t receive damage, but can\u2019t prevent the sharp pain.<br> (Fundamentally not used in \u300EFateGO\u300F)</p><h1 id="curruid-coinchenn-beast-of-crunching-death-fangs" tabindex="-1"><a class="header-anchor" href="#curruid-coinchenn-beast-of-crunching-death-fangs" aria-hidden="true">#</a> Curruid Coinchenn - Beast of Crunching Death Fangs</h1><ul><li>Rank: A</li><li>Type: Anti-Unit Noble Phantasm</li><li>Range: \u2014</li><li>Maximum number of targets: 1 person</li></ul><p>Curruid Coinchenn.<br> The rage of the rampaging C\xFA Chulainn temporarily embodies the skeleton of the monster of the Red Sea who became the origin of the demonic spear G\xE1e Bolg, the marine beast Curruid, and clads his body in it as an armor. An offensive-type bone armor. Wearing it ranks-up his Endurance, and his Strength parameter becomes EX.<br> \u300ESoaring spear that strikes with death\u300F can\u2019t be used while activating this Noble Phantasm.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><p>First person pronoun: \u4FFA (ore)<br> Second person pronoun: \u304A\u524D (omae) / \u3066\u3081\u3047 (temee) / \u8CB4\u69D8\u306A\u3069 (kisama nado)<br> Third person pronoun: \u3042\u3044\u3064 (aitsu)</p><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>C\xFA Chulainn, who has become a king of massacre.<br> He has acquired a ferociousness and nature like those of a beast, but the vigor of his life force isn\u2019t something to \u300Csurvive\u300D, but to \u300Clead to death\u300D.<br> What is the wish of a beast? It\u2019s not survival. It\u2019s dashing. Beasts eat meat to survive and not to scamper. That\u2019s why this C\xFA Chulainn discards even the desire to \u201Ceat\u201D as useless.<br> Just fast. Just far. Just meaninglessly. As if believing that the place where he will fall after using up all his strength is his goal.</p><p>He will murder the enemy whether it\u2019s a good person, a Heroic Spirit, or a friend.<br> He doesn\u2019t think fighting is fun. If it\u2019s standing as an enemy, he won\u2019t hesitate even if he\u2019s facing Sc\xE1thach.<br> If an ally repeats a mistake, there won\u2019t be mercy.<br> The lack of pangs of the one who stands at the top of the soldiers of the warrior race, the Celts, would make anyone shake.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>The attitude towards the Master is complete indifference.<br> Since he thinks of himself as a battle machine and as a blade, he won\u2019t oppose any unreasonable order if he thinks it\u2019s not impossible.<br> However, he won\u2019t respond to any order that has to do with doing something other than battle related things at all.<br> He has the strong will to think he\u2019s just a being that kills the enemies, and not to be concerned in anything besides that.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u300EI\u2019m an unimportant warrior of Ulster.<br> Since I\u2019ve been summoned as a Servant, I\u2019ll do what I gotta do\u300F</p><p>\u300EDon\u2019t take the personality of Servants much into account. We\u2019re weapons after all.<br> They too, I too, will turn into enemies at any moment if it\u2019s necessary\u300F</p><p>\u300EAll curses released. No moderation, challenge despair\u2026\u2026 Curruid Coinchenn!\u300F</p><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>The brave hero of the Celtic Ulster cycle.<br> A member of the Order of the Red Branch as well as Ulster\u2019s strongest warrior, he won fame by freely using the invincible demonic spearmanship received from the leader of the spirit world \u300CThe Land of Shadows\u300D, Sc\xE1thach.<br> Manifesting as a Berserker, the equipment of his whole body turns black, and his personality changes too. His facial expression is ruthless, his Noble Phantasm demonic spear becomes red mixed with black, and he projects a sinister presence.</p><p>A Servant reflecting Queen Medb\u2019s wish for \u300CC\xFA Chulainn to be an evil king similar to me\u300D. He abandoned the cheerfulness of C\xFA Chulainn, and exposed his side as a battle machine.</p><p>That the Celtic soldiers opposed in the fifth chapter were merciless was not only by Medb\u2019s power, but also because they were led by C\xFA Chulainn\u2019s cruelty.<br> He continues fighting not out of joy as a warrior, but only in order to prove that he\u2019s the \u300Cking\u300D.<br> Many Servants have accused his way of being of \u300Cfoolish\u300D, but that\u2019s natural. The \u300Ckings\u300D that C\xFA Chulainn saw were, without exception, foolish.<br> That said, his thirst for victory is by far stronger than that of the normal C\xFA Chulainn. That\u2019s because winning is an obvious duty.<br> Logical cogitation and speech are possible, but since all of them are vectorially directed to \u300Cwinning battles\u300D, a conversation with the opponents can\u2019t fundamentally be established. Because of that, he has no mercy and begging for one\u2019s life has no effect.</p><p>He can throw G\xE1e Bolg with its throwing version, but the power is higher than that of the usual G\xE1e Bolg.<br> As a compensation, his right arm will be damaged to the point of being torn off each time he activates it, but that\u2019s compensated by regenerating and recovering it with Rune magecraft.<br> Only the sharp pain, enough to make an ordinary person go crazy, can\u2019t be prevented, but C\xFA Chulainn eludes it by simply enduring it.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Medb</strong></p><p>She gave birth to C\xFA Chulainn (Alter). The queen that kept directing her impossibly distorted, as well as ardent, affection to him.</p><p><strong>Sc\xE1thach</strong></p><p>The largest wall. Crush her, overcome her, trample her. Don\u2019t long to battle, aspire to win. Simply just feed the emptiness gained after winning to the dogs.</p><p><strong>C\xFA Chulainn</strong></p><p>My positive side. \u2026\u2026Ain\u2019t he too bright? Is this for real?</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>I got a designation to do a distorted king C\xFA Chulainn, but C\xFA Chulainn has the image of a warrior in my head, so I went through Hell working to fill the image gap. The number of rejected drafts is overwhelmingly larger compared to other characters, and in the end I put all the parts together and made him thorny with tail, cape, and tattoos, but it caused a lot of trouble with the consistency in the three views. Since what he\u2019s wearing is the skeleton of Curruid, same as his spear, as armor, I introduced marine life designs on the whole. (Shimadrill)</p><h2 id="tl-notes" tabindex="-1"><a class="header-anchor" href="#tl-notes" aria-hidden="true">#</a> TL Notes</h2><p>[1]: \u7CBE\u970A is &quot;spirit&quot;, but it&#39;s used to refer to Elementals in the Nasuverse, so I changed the translation to make it more fitting.</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p>(Lib will add after publish)</p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 60);
